import React from "react";
import './App.css';

import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Navigation from "./Navigation";
import Register from "./Register";
import Login from "./Login";
import Welcome from "./Welcome";

function App() {
  return (
      <Router>
          <Navigation />

          <Switch>
              <Route path="/home">
                  <App />
              </Route>
              <Route path="/register">
                  <Register />
              </Route>
              <Route path="/login">
                  <Login />
              </Route>
              <Route path="/welcome">
                  <Welcome />
              </Route>
              <Route path="/welcome">
                  <Welcome />
              </Route>
              <Route path="/">
                  <App />
              </Route>
          </Switch>

      </Router>
  );
}

export default App;
